export default function uploadPhoto(filename) {
  return new Promise((resolve, reject) => {
    setTimeout(() => {
      if (Math.random() > 0.5) {
        resolve(`https://server.com/${filename}`);
      } else {
        reject(new Error('Error'));
      }
    }, 1000);
  });
}

